import * as React from 'react';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Box';
import { ListGroup } from 'react-bootstrap';

const backgroundImage = 'https://images.unsplash.com/photo-1542052125323-e69ad37a47c2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80';

export default function About() {
  return (


    <>
    <Container></Container>
    <Typography>Welcome to our Travel Blog</Typography>
    <Container sx={{
      backgroundImage: `url(${backgroundImage})`,
      backgroundPosition: 'center',
      backgroundSize: 'cover',
      height: "800px",
    }}>
      <Paper>
        <Typography variant="h4" component="h1" gutterBottom>
          Create React App example
        </Typography>
      </Paper>
    </Container>
    </>
  );
}
